import React from 'react';
import {Head} from './styles'

const Header = () => {
  return (
    <Head>
      <figure><img src="" alt="" /></figure>
      <nav>
      <ul>
        <li><a href="">canciones</a></li>
        <li><a href="">acordes</a></li>
      </ul>
      </nav> 
      <div>
        <input type='text' placeholder="buscar" />
        <input type="submit" />
      </div>
    </Head>
  );
};

export default Header;
